	static class Pair {
		String word1;
		String word2;
		
		public Pair(String w, String w2) {
			word1 = w;
			word2 = w2;
		}
		
		public void setWord1(String w) {
			this.word1 = w;
		}
		
		public void setWord2(String w) {
			this.word2 = w;
		}
		
		public String getWord1() {
			return this.word1;
		}
		
		public String getWord2() {
			return this.word2;
		}
		
		public boolean equals(Object test) {
			//self-comparison
			if (this == test) return true;
			
			//make sure the tested object is a Pair
			if (!(test instanceof Pair)) return false;
			
			//cast is safe by above
			Pair toTest = (Pair) test;
			
			return
				this.word1.equals(toTest.word1) &&
				this.word2.equals(toTest.word2);
		}
		
		public int hashCode() {
			return Objects.hash(this.word1, this.word2);
		}
	}
